import React, {Component} from "react";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';

const styles = theme => ({
    root: {
      background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
      border: 0,
      borderRadius: 3,
      boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
      color: 'white',
      height: 48,
      padding: '0 30px',
    },
  });


export default class NavTop extends Component {

    render(){

        const showNav = this.props.state.showNav

        return(
            <>
                <div className={`reset-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>

                </div>
                <div className="progress-bar-container">

                </div>
                <div className={`speed-options-container nav-top-${showNav ? 'active' : 'inactive'}`} sx={{ width: '100%' }}>
                <Tabs
                    // value={value}
                    // onChange={handleChange}
                    textColor="secondary"
                    indicatorColor="secondary"
                    aria-label="secondary tabs example"
                    className="speed-tabs"
                    variant="fullWidth"
                >
                    <Tab value="one" label="Item One" />
                    <Tab value="two" label="Item Two" />
                    <Tab value="three" label="Item Three" />
                </Tabs>
                </div>
            </>
        )
    }
}
